using PWAPhotos.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace PWAPhotos.Data
{
    public class DBInitializer
    {
        public static async Task InitializeAsync(DBContext context)
        {

            // Look for any students.
            if (context.Images.Any())
            {
                return;   // DB has been seeded
            }
            var img1 = "";
            var img2 = "";
            var bytes1 = Convert.FromBase64String(img1);
            var bytes2 = Convert.FromBase64String(img2);


            var images = new ImageDTO[]
            {
                new ImageDTO{ 
                    Id=1,
                    Data= bytes1
                },
                new ImageDTO{
                    Id=2,
                    Data= bytes2
                }
            };

            foreach (ImageDTO i in images)
            {
                await context.Images.AddAsync(i);
            }

            await context.SaveChangesAsync();
        }
    }
}
